export default function Users({usersData}) {
    const users = usersData || [{
        first_name: 'First',
        last_name: 'Last',
        role: 'Project Lead',
        avatar: 'http://placekitten.com/200/300',
        city: 'New York'
    }]
    const CardGenerator = () => {

        const Card = ({user, id}) => {
            return (
                <div style={{flex: '0 0 auto'}} className='justify-center pl-4 pt-4'>
                    <img src={users[id].avatar} className='w-32 h-32 rounded-full'/>
                    <div className="text-left w-3/4">
                        <h3 className="text-lg font-f1">{users[id].first_name+' '+users[id].last_name}</h3>
                        <p className='text-xs font-f1 font-thin'>{users[id].role}</p>
                        <p className='text-xs font-f1 font-thin'>{users[id].city}</p>
                    </div>
                </div>
            )
        }
        const cards = users.map((user, i) => (<Card user={user} id={i} />))
        return cards

    }
    return(
        <div className="flex flex-no-wrap overflow-auto">
            <CardGenerator />
        </div>
    )
}
